import logo from './logo.svg';
import './App.css';
// import Top from '../src/Component/Login/Navbar/Top'
// import Bottom from '../src/Component/Login/Bottom/Bottom'
import Register from './Component/Register/Register'
import Login from './Component/Login/Login'
import Timeline from './Component/Timeline/Timeline'
// import Left from '../src/Component/Login/Left/Left'
// import Fixed from '../src/Component/Login/Fixed'
import Navbar from './Component/Register/Navbar/Navbar'
import Footer from './Component/Register/Footer/Footer'
import Leftpart from '../src/Component/Register/Leftpart/Leftpart'
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';

function App() {
  return (

    <div> 
  <Navbar />
  <div className="container">
<div className="content">
 <Router >


    <Switch>
    <Route path="/" exact component={Register} /> 
    <Route path="/Login"  component={Login} />
    <Route path="/Register" component={Register} />
    <Route path="/Timeline"  component={Timeline} />

    </Switch>

  </Router>
  </div>
  </div>

  <Footer />
    </div>

  );
}

export default App;
